script: |
  super -f text -I q1085.spq | sort > q1085.out

inputs:
  - name: q1085.spq
    data: |
      SELECT DISTINCT + col2 * + col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 + 78 + - ( + 99 ) IN ( col1 + - col0, col1 / 22, + col0 );
  - name: tab0

outputs:
  - name: q1085.out
    data: |
      705
      870
      9603
